import React, {Component} from 'react';
import '../../css/Home.css';
import HomeContent from './HomeContent.js';
import SideStandings from './SideStandings';

class Home extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div className="row">
                <div className="col1">
                    <HomeContent/>
                </div>
                <div className="col2">
                    <SideStandings/>
                </div>
            </div>
        )
    }
}

export default Home;
